          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](98, "2.6. \u041E\u0441\u0443\u0449\u0435\u0441\u0442\u0432\u043B\u044F\u044F \u0434\u043E\u0441\u0442\u0443\u043F \u043A Altair \u0438 \u0437\u0430\u043A\u043B\u044E\u0447\u0430\u044F \u0442\u0430\u043A\u0438\u043C \u043E\u0431\u0440\u0430\u0437\u043E\u043C \u043D\u0430\u0441\u0442\u043E\u044F\u0449\u0435\u0435 \u041F\u043E\u043B\u044C\u0437\u043E\u0432\u0430\u0442\u0435\u043B\u044C\u0441\u043A\u043E\u0435 \u0441\u043E\u0433\u043B\u0430\u0448\u0435\u043D\u0438\u0435, \u041F\u043E\u043B\u044C\u0437\u043E\u0432\u0430\u0442\u0435\u043B\u044C \u0433\u0430\u0440\u0430\u043D\u0442\u0438\u0440\u0443\u0435\u0442, \u0447\u0442\u043E \u043E\u0431\u043B\u0430\u0434\u0430\u0435\u0442 \u0432\u0441\u0435\u043C\u0438 \u043F\u0440\u0430\u0432\u0430\u043C\u0438 \u0438 \u043F\u043E\u043B\u043D\u043E\u043C\u043E\u0447\u0438\u044F\u043C\u0438, \u043D\u0435\u043E\u0431\u0445\u043E\u0434\u0438\u043C\u044B\u043C\u0438 \u0434\u043B\u044F \u0437\u0430\u043A\u043B\u044E\u0447\u0435\u043D\u0438\u044F \u0438 \u0438\u0441\u043F\u043E\u043B\u043D\u0435\u043D\u0438\u044F \u041F\u043E\u043B\u044C\u0437\u043E\u0432\u0430\u0442\u0435\u043B\u044C\u0441\u043A\u043E\u0433\u043E \u0441\u043E\u0433\u043B\u0430\u0448\u0435\u043D\u0438\u044F, \u0432 \u0442\u043E\u043C \u0447\u0438\u0441\u043B\u0435 \u044F\u0432\u043B\u044F\u0435\u0442\u0441\u044F \u0441\u043E\u0432\u0435\u0440\u0448\u0435\u043D\u043D\u043E\u043B\u0435\u0442\u043D\u0438\u043C \u0438 \u043F\u043E\u043B\u043D\u043E\u0441\u0442\u044C\u044E \u0434\u0435\u0435\u0441\u043F\u043E\u0441\u043E\u0431\u043D\u044B\u043C \u043B\u0438\u0446\u043E\u043C, \u043B\u0438\u0431\u043E \u043D\u0435\u0441\u043E\u0432\u0435\u0440\u0448\u0435\u043D\u043D\u043E\u043B\u0435\u0442\u043D\u0438\u043C \u043B\u0438\u0446\u043E\u043C, \u043E\u0431\u044A\u044F\u0432\u043B\u0435\u043D\u043D\u044B\u043C \u043F\u043E \u0440\u0435\u0448\u0435\u043D\u0438\u044E \u0443\u043F\u043E\u043B\u043D\u043E\u043C\u043E\u0447\u0435\u043D\u043D\u043E\u0433\u043E \u043E\u0440\u0433\u0430\u043D\u0430 \u043F\u043E\u043B\u043D\u043E\u0441\u0442\u044C\u044E \u0434\u0435\u0435\u0441\u043F\u043E\u0441\u043E\u0431\u043D\u044B\u043C (\u044D\u043C\u0430\u043D\u0441\u0438\u043F\u0430\u0446\u0438\u044F) \u043B\u0438\u0431\u043E \u043D\u0435\u0441\u043E\u0432\u0435\u0440\u0448\u0435\u043D\u043D\u043E\u043B\u0435\u0442\u043D\u0438\u043C \u043B\u0438\u0446\u043E\u043C, \u0434\u043E\u0441\u0442\u0438\u0433\u0448\u0438\u043C \u0447\u0435\u0442\u044B\u0440\u043D\u0430\u0434\u0446\u0430\u0442\u0438 \u043B\u0435\u0442 \u0438 \u043F\u043E\u043B\u0443\u0447\u0438\u0432\u0448\u0438\u043C \u043F\u0438\u0441\u044C\u043C\u0435\u043D\u043D\u043E\u0435 \u0440\u0430\u0437\u0440\u0435\u0448\u0435\u043D\u0438\u0435 \u0432 \u0442\u0440\u0435\u0431\u0443\u0435\u043C\u043E\u0439 \u0437\u0430\u043A\u043E\u043D\u043E\u043C \u0444\u043E\u0440\u043C\u0435 \u043E\u0442 \u0441\u0432\u043E\u0438\u0445 \u0440\u043E\u0434\u0438\u0442\u0435\u043B\u0435\u0439 \u0438\u043B\u0438 \u0438\u043D\u044B\u0445 \u0437\u0430\u043A\u043E\u043D\u043D\u044B\u0445 \u043F\u0440\u0435\u0434\u0441\u0442\u0430\u0432\u0438\u0442\u0435\u043B\u0435\u0439 \u043D\u0430 \u0437\u0430\u043A\u043B\u044E\u0447\u0435\u043D\u0438\u0435 \u041F\u043E\u043B\u044C\u0437\u043E\u0432\u0430\u0442\u0435\u043B\u044C\u0441\u043A\u043E\u0433\u043E \u0441\u043E\u0433\u043B\u0430\u0448\u0435\u043D\u0438\u044F. \u0410\u043B\u044C\u0442\u0430\u0438\u0440 \u0432\u043F\u0440\u0430\u0432\u0435 \u0432 \u043B\u044E\u0431\u043E\u0435 \u0432\u0440\u0435\u043C\u044F \u043F\u043E\u0442\u0440\u0435\u0431\u043E\u0432\u0430\u0442\u044C \u043E\u0442 \u041F\u043E\u043B\u044C\u0437\u043E\u0432\u0430\u0442\u0435\u043B\u044F \u043F\u0440\u0435\u0434\u043E\u0441\u0442\u0430\u0432\u043B\u0435\u043D\u0438\u0435 \u0438\u043D\u0444\u043E\u0440\u043C\u0430\u0446\u0438\u0438 \u0438 \u0434\u043E\u043A\u0443\u043C\u0435\u043D\u0442\u043E\u0432, \u043F\u043E\u0434\u0442\u0432\u0435\u0440\u0436\u0434\u0430\u044E\u0449\u0438\u0445 \u043F\u0440\u0430\u0432\u0430 \u0438 \u043F\u043E\u043B\u043D\u043E\u043C\u043E\u0447\u0438\u044F, \u043A\u0430\u043A \u0443\u043A\u0430\u0437\u0430\u043D\u043E \u0432\u044B\u0448\u0435.");

