          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](115, "3.5. \u041F\u043E\u043B\u044C\u0437\u043E\u0432\u0430\u0442\u0435\u043B\u044C \u043E\u0431\u044F\u0437\u0430\u043D \u043D\u0435\u043C\u0435\u0434\u043B\u0435\u043D\u043D\u043E \u0438\u0437\u043C\u0435\u043D\u0438\u0442\u044C \u0423\u0447\u0435\u0442\u043D\u044B\u0435 \u0434\u0430\u043D\u043D\u044B\u0435, \u0435\u0441\u043B\u0438 \u0443 \u043D\u0435\u0433\u043E \u0435\u0441\u0442\u044C \u043F\u0440\u0438\u0447\u0438\u043D\u044B \u043F\u043E\u0434\u043E\u0437\u0440\u0435\u0432\u0430\u0442\u044C, \u0447\u0442\u043E \u044D\u0442\u0438 \u0434\u0430\u043D\u043D\u044B\u0435 \u0431\u044B\u043B\u0438 \u0440\u0430\u0441\u043A\u0440\u044B\u0442\u044B \u0438\u043B\u0438 \u043C\u043E\u0433\u0443\u0442 \u0431\u044B\u0442\u044C \u0438\u0441\u043F\u043E\u043B\u044C\u0437\u043E\u0432\u0430\u043D\u044B \u043D\u0435\u0443\u043F\u043E\u043B\u043D\u043E\u043C\u043E\u0447\u0435\u043D\u043D\u044B\u043C\u0438 \u0438\u043C \u0442\u0440\u0435\u0442\u044C\u0438\u043C\u0438 \u043B\u0438\u0446\u0430\u043C\u0438.");

