          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](132, "\u0420\u0430\u0437\u043C\u0435\u0449\u0430\u044F \u043D\u0430 Altair \u041E\u0431\u044A\u044F\u0432\u043B\u0435\u043D\u0438\u044F, \u041F\u043E\u043B\u044C\u0437\u043E\u0432\u0430\u0442\u0435\u043B\u044C \u0434\u0435\u043B\u0430\u0435\u0442 \u0421\u0432\u0435\u0434\u0435\u043D\u0438\u044F, \u0443\u043A\u0430\u0437\u0430\u043D\u043D\u044B\u0435 \u0432 \u041E\u0431\u044A\u044F\u0432\u043B\u0435\u043D\u0438\u0438, \u043E\u0431\u0449\u0435\u0434\u043E\u0441\u0442\u0443\u043F\u043D\u044B\u043C\u0438 \u0438 \u043F\u043E\u043D\u0438\u043C\u0430\u0435\u0442, \u0447\u0442\u043E \u0440\u0430\u0437\u043C\u0435\u0449\u0435\u043D\u043D\u0430\u044F \u0438\u043D\u0444\u043E\u0440\u043C\u0430\u0446\u0438\u044F \u043F\u0443\u0431\u043B\u0438\u043A\u0443\u0435\u0442\u0441\u044F \u043D\u0430 Altair \u0432 \u043E\u0442\u043A\u0440\u044B\u0442\u043E\u043C \u0434\u043E\u0441\u0442\u0443\u043F\u0435, \u0442\u043E \u0435\u0441\u0442\u044C \u0434\u043E\u0441\u0442\u0443\u043F\u043D\u0430 \u0434\u043B\u044F \u043E\u0437\u043D\u0430\u043A\u043E\u043C\u043B\u0435\u043D\u0438\u044F \u043B\u044E\u0431\u043E\u043C\u0443 \u043F\u043E\u0441\u0435\u0442\u0438\u0442\u0435\u043B\u044E Altair (\u043D\u0435\u043E\u0433\u0440\u0430\u043D\u0438\u0447\u0435\u043D\u043D\u043E\u043C\u0443 \u043A\u0440\u0443\u0433\u0443 \u043B\u0438\u0446) \u043D\u0430 \u0442\u0435\u0440\u0440\u0438\u0442\u043E\u0440\u0438\u0438 \u0432\u0441\u0435\u0445 \u0441\u0442\u0440\u0430\u043D \u043C\u0438\u0440\u0430, \u0433\u0434\u0435 \u0438\u043C\u0435\u0435\u0442\u0441\u044F \u0432\u043E\u0437\u043C\u043E\u0436\u043D\u043E\u0441\u0442\u044C \u0438\u0441\u043F\u043E\u043B\u044C\u0437\u043E\u0432\u0430\u043D\u0438\u044F \u0441\u0435\u0442\u0438 \u0418\u043D\u0442\u0435\u0440\u043D\u0435\u0442 \u0438 \u0434\u043E\u0441\u0442\u0443\u043F\u0430 \u043A \u0441\u0430\u0439\u0442\u0443, \u0441\u043E\u043E\u0442\u0432\u0435\u0442\u0441\u0442\u0432\u0435\u043D\u043D\u043E \u041F\u043E\u043B\u044C\u0437\u043E\u0432\u0430\u0442\u0435\u043B\u044C \u043F\u043E\u043D\u0438\u043C\u0430\u0435\u0442 \u0438 \u043F\u0440\u0438\u043D\u0438\u043C\u0430\u0435\u0442 \u043D\u0430 \u0441\u0435\u0431\u044F \u0432\u0441\u0435 \u0440\u0438\u0441\u043A\u0438, \u0441\u0432\u044F\u0437\u0430\u043D\u043D\u044B\u0435 \u0441 \u0442\u0430\u043A\u0438\u043C \u0440\u0430\u0437\u043C\u0435\u0449\u0435\u043D\u0438\u0435\u043C \u0438\u043D\u0444\u043E\u0440\u043C\u0430\u0446\u0438\u0438, \u0432 \u0442\u043E\u043C \u0447\u0438\u0441\u043B\u0435, \u0432\u043A\u043B\u044E\u0447\u0430\u044F, \u043D\u043E \u043D\u0435 \u043E\u0433\u0440\u0430\u043D\u0438\u0447\u0438\u0432\u0430\u044F\u0441\u044C: \u0440\u0438\u0441\u043A \u043F\u043E\u043F\u0430\u0434\u0430\u043D\u0438\u044F \u0430\u0434\u0440\u0435\u0441\u0430 \u044D\u043B\u0435\u043A\u0442\u0440\u043E\u043D\u043D\u043E\u0439 \u043F\u043E\u0447\u0442\u044B \u0432 \u0441\u043F\u0438\u0441\u043A\u0438 \u0434\u043B\u044F \u0440\u0430\u0441\u0441\u044B\u043B\u043A\u0438 \u0441\u043F\u0430\u043C-\u0441\u043E\u043E\u0431\u0449\u0435\u043D\u0438\u0439, \u0440\u0438\u0441\u043A \u043F\u043E\u043F\u0430\u0434\u0430\u043D\u0438\u044F \u0430\u0434\u0440\u0435\u0441\u0430 \u044D\u043B\u0435\u043A\u0442\u0440\u043E\u043D\u043D\u043E\u0439 \u043F\u043E\u0447\u0442\u044B \u043A \u0440\u0430\u0437\u043B\u0438\u0447\u043D\u043E\u0433\u043E \u0440\u043E\u0434\u0430 \u043C\u043E\u0448\u0435\u043D\u043D\u0438\u043A\u0430\u043C, \u0440\u0438\u0441\u043A \u043F\u043E\u043F\u0430\u0434\u0430\u043D\u0438\u044F \u0442\u0435\u043B\u0435\u0444\u043E\u043D\u043D\u043E\u0433\u043E \u043D\u043E\u043C\u0435\u0440\u0430 \u043A SMS-\u0441\u043F\u0430\u043C\u0435\u0440\u0430\u043C \u0438/\u0438\u043B\u0438 SMS-\u043C\u043E\u0448\u0435\u043D\u043D\u0438\u043A\u0430\u043C \u0438 \u0438\u043D\u044B\u0435 \u0440\u0438\u0441\u043A\u0438, \u0432\u044B\u0442\u0435\u043A\u0430\u044E\u0449\u0438\u0435 \u0438\u0437 \u0442\u0430\u043A\u043E\u0433\u043E \u0440\u0430\u0437\u043C\u0435\u0449\u0435\u043D\u0438\u044F \u0438\u043D\u0444\u043E\u0440\u043C\u0430\u0446\u0438\u0438.");

