          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](134, "4.4. \u0410\u043B\u044C\u0442\u0430\u0438\u0440 \u043D\u0435 \u043E\u0431\u044F\u0437\u0430\u043D\u043E \u043E\u0441\u0443\u0449\u0435\u0441\u0442\u0432\u043B\u044F\u0442\u044C \u043F\u0440\u0435\u0434\u0432\u0430\u0440\u0438\u0442\u0435\u043B\u044C\u043D\u0443\u044E \u043F\u0440\u043E\u0432\u0435\u0440\u043A\u0443 \u0421\u0432\u0435\u0434\u0435\u043D\u0438\u0439 \u043B\u044E\u0431\u043E\u0433\u043E \u0432\u0438\u0434\u0430, \u0440\u0430\u0437\u043C\u0435\u0449\u0430\u0435\u043C\u044B\u0445 \u0438/\u0438\u043B\u0438 \u0440\u0430\u0441\u043F\u0440\u043E\u0441\u0442\u0440\u0430\u043D\u044F\u0435\u043C\u044B\u0445 \u041F\u043E\u043B\u044C\u0437\u043E\u0432\u0430\u0442\u0435\u043B\u0435\u043C \u043F\u043E\u0441\u0440\u0435\u0434\u0441\u0442\u0432\u043E\u043C Altair. \u0410\u043B\u044C\u0442\u0430\u0438\u0440 \u0438\u043C\u0435\u0435\u0442 \u043F\u0440\u0430\u0432\u043E \u043F\u043E \u0441\u0432\u043E\u0435\u043C\u0443 \u0443\u0441\u043C\u043E\u0442\u0440\u0435\u043D\u0438\u044E \u043E\u0442\u043A\u0430\u0437\u0430\u0442\u044C \u041F\u043E\u043B\u044C\u0437\u043E\u0432\u0430\u0442\u0435\u043B\u044E \u0432 \u0440\u0430\u0437\u043C\u0435\u0449\u0435\u043D\u0438\u0438 \u0438/\u0438\u043B\u0438 \u0440\u0430\u0441\u043F\u0440\u043E\u0441\u0442\u0440\u0430\u043D\u0435\u043D\u0438\u0438 \u0438\u043C \u043B\u044E\u0431\u044B\u0445 \u0421\u0432\u0435\u0434\u0435\u043D\u0438\u0439 \u0438\u043B\u0438 \u0443\u0434\u0430\u043B\u0438\u0442\u044C \u043B\u044E\u0431\u044B\u0435 \u0421\u0432\u0435\u0434\u0435\u043D\u0438\u044F, \u043A\u043E\u0442\u043E\u0440\u044B\u0435 \u0440\u0430\u0437\u043C\u0435\u0449\u0435\u043D\u044B \u041F\u043E\u043B\u044C\u0437\u043E\u0432\u0430\u0442\u0435\u043B\u0435\u043C \u043D\u0430 Altair. \u041F\u043E\u043B\u044C\u0437\u043E\u0432\u0430\u0442\u0435\u043B\u044C \u043E\u0441\u043E\u0437\u043D\u0430\u0435\u0442 \u0438 \u0441\u043E\u0433\u043B\u0430\u0441\u0435\u043D \u0441 \u0442\u0435\u043C, \u0447\u0442\u043E \u043E\u043D \u0434\u043E\u043B\u0436\u0435\u043D \u0441\u0430\u043C\u043E\u0441\u0442\u043E\u044F\u0442\u0435\u043B\u044C\u043D\u043E \u043E\u0446\u0435\u043D\u0438\u0432\u0430\u0442\u044C \u0432\u0441\u0435 \u0440\u0438\u0441\u043A\u0438, \u0441\u0432\u044F\u0437\u0430\u043D\u043D\u044B\u0435 \u0441 \u0440\u0430\u0437\u043C\u0435\u0449\u0435\u043D\u0438\u0435\u043C \u0438 \u0440\u0430\u0441\u043F\u0440\u043E\u0441\u0442\u0440\u0430\u043D\u0435\u043D\u0438\u0435\u043C \u043B\u044E\u0431\u044B\u0445 \u0421\u0432\u0435\u0434\u0435\u043D\u0438\u0439, \u0432\u043A\u043B\u044E\u0447\u0430\u044F \u043E\u0446\u0435\u043D\u043A\u0443 \u043D\u0430\u0434\u0435\u0436\u043D\u043E\u0441\u0442\u0438, \u043F\u043E\u043B\u043D\u043E\u0442\u044B \u0438\u043B\u0438 \u043F\u043E\u043B\u0435\u0437\u043D\u043E\u0441\u0442\u0438 \u0442\u0430\u043A\u043E\u0432\u043E\u0433\u043E.");

