          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](136, "4.5. \u0410\u043B\u044C\u0442\u0430\u0438\u0440 \u043D\u0435 \u043E\u043A\u0430\u0437\u044B\u0432\u0430\u0435\u0442 \u043A\u043E\u043D\u0441\u0443\u043B\u044C\u0442\u0430\u0446\u0438\u0439 \u043F\u043E \u0432\u043E\u043F\u0440\u043E\u0441\u0430\u043C, \u043D\u0435 \u043E\u0442\u043D\u043E\u0441\u044F\u0449\u0438\u043C\u0441\u044F \u043A Altair, \u0442\u0440\u0435\u0431\u0443\u044E\u0449\u0438\u043C \u043F\u0440\u043E\u0444\u0435\u0441\u0441\u0438\u043E\u043D\u0430\u043B\u044C\u043D\u043E\u0439 \u043E\u0446\u0435\u043D\u043A\u0438 \u0438/\u0438\u043B\u0438 \u043D\u0435 \u0432\u0445\u043E\u0434\u044F\u0449\u0438\u0445 \u0432 \u043A\u043E\u043C\u043F\u0435\u0442\u0435\u043D\u0446\u0438\u044E \u0410\u043B\u044C\u0442\u0430\u0438\u0440.");

