          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](147, "5.2. \u0414\u043E\u0441\u0442\u0443\u043F\u043D\u044B\u0435 \u041F\u043E\u043B\u044C\u0437\u043E\u0432\u0430\u0442\u0435\u043B\u044E \u0421\u0435\u0440\u0432\u0438\u0441\u044B Altair \u043C\u043E\u0433\u0443\u0442 \u0431\u044B\u0442\u044C \u0438\u0441\u043F\u043E\u043B\u044C\u0437\u043E\u0432\u0430\u043D\u044B \u0438\u0441\u043A\u043B\u044E\u0447\u0438\u0442\u0435\u043B\u044C\u043D\u043E \u0432 \u0446\u0435\u043B\u044F\u0445, \u0434\u043B\u044F \u043A\u043E\u0442\u043E\u0440\u044B\u0445 \u0442\u0430\u043A\u0438\u0435 \u0421\u0435\u0440\u0432\u0438\u0441\u044B \u043F\u0440\u0435\u0434\u043D\u0430\u0437\u043D\u0430\u0447\u0435\u043D\u044B \u0410\u043B\u044C\u0442\u0430\u0438\u0440. \u041F\u043E\u043B\u044C\u0437\u043E\u0432\u0430\u0442\u0435\u043B\u044E \u0437\u0430\u043F\u0440\u0435\u0449\u0430\u0435\u0442\u0441\u044F \u0438\u0441\u043F\u043E\u043B\u044C\u0437\u043E\u0432\u0430\u0442\u044C \u0421\u0435\u0440\u0432\u0438\u0441\u044B, \u0430 \u0442\u0430\u043A\u0436\u0435 \u043B\u044E\u0431\u0443\u044E \u043F\u043E\u043B\u0443\u0447\u0435\u043D\u043D\u0443\u044E \u043D\u0430 \u0421\u0430\u0439\u0442\u0435 \u0438\u043D\u0444\u043E\u0440\u043C\u0430\u0446\u0438\u044E \u043D\u0435 \u043F\u043E \u043D\u0430\u0437\u043D\u0430\u0447\u0435\u043D\u0438\u044E.");

